import React from "react";
import { Link } from "react-router-dom";
import { motion } from "framer-motion";
import "bootstrap/dist/css/bootstrap.min.css";
import "../App.css";

const Navbar = ({ isAuthenticated, handleLogout }) => {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-gradient shadow-lg">
      <div className="container">
        {/* Logo with animation */}
        <motion.div whileHover={{ scale: 1.1 }}>
          <Link className="navbar-brand d-flex align-items-center" to="/">
            <img src="data:image/png;base64," alt="Logo" className="logo me-2" />
            <span className="fw-bold fs-4">Auction App</span>
          </Link>
        </motion.div>

        {/* Mobile Menu Button */}
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNav"
        >
          <span className="navbar-toggler-icon"></span>
        </button>

        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ms-auto">
            {["signup", "signin", "dashboard", "post-auction"].map((path, index) => (
              <motion.li
                key={index}
                className="nav-item"
                whileHover={{ scale: 1.1 }}
                whileTap={{ scale: 0.9 }}
              >
                <Link className="nav-link custom-nav-link" to={`/${path}`}>
                  {path.charAt(0).toUpperCase() + path.slice(1)}
                </Link>
              </motion.li>
            ))}
            {isAuthenticated && (
              <motion.li
                className="nav-item"
                whileHover={{ scale: 1.1 }}
                whileTap={{ scale: 0.9 }}
              >
                <button className="btn btn-danger ms-3 shadow" onClick={handleLogout}>
                  Logout
                </button>
              </motion.li>
            )}
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
